import React, { useEffect, useState, useCallback } from "react";
import { Link, useHistory } from "react-router-dom";
import { Swal } from "sweetalert2";
import axios from "axios";
import AOS from "aos";
import jQuery from "jquery";
import $ from "jquery";

jQuery(function ($) {
    var tableId = "#datatable";

    var tableHead = document.querySelector(".sticky-nav");
    tableHead.addEventListener("sticky-change", function (e) {
        // when  thead becomes sticky, add is-stuck class to it (which adds a border-bottom to it)
        this.classList.toggle("is-stuck", e.detail.isSticky);
    });

    $.extend(true, $.fn.dataTable.defaults, {
        dom:
            "<'row'<'col-12 col-sm-6'l><'col-12 col-sm-6 text-right table-tools-col'f>>" +
            "<'row'<'col-12'tr>>" +
            "<'row'<'col-12 col-md-5'i><'col-12 col-md-7'p>>",
        renderer: "bootstrap",
    });

    var $_table = $(tableId).DataTable({
        responsive: true,

        /** optional scrolling **/
        // scrollY: "300px",
        // scrollCollapse: true,

        colReorder: {
            //disable column reordering for first and last columns
            fixedColumnsLeft: 1,
            fixedColumnsRight: 1,
        },

        // sDom: 'BRfrtlip',

        classes: {
            sLength: "dataTables_length text-left w-auto",
        },

        buttons: {
            dom: {
                button: {
                    className: "btn", //remove the default 'btn-secondary'
                },
                container: {
                    className:
                        "dt-buttons btn-group bgc-white-tp2 text-right w-auto",
                },
            },

            buttons: [
                {
                    extend: "colvis",
                    text: "<i class='far fa-eye text-125 text-dark-m2'></i> <span class='d-none'>Show/hide columns</span>",
                    className:
                        "btn-light-default btn-bgc-white btn-h-outline-primary btn-a-outline-primary",
                    columns: ":not(:first)",
                },

                {
                    extend: "copy",
                    text: "<i class='far fa-copy text-125 text-purple'></i> <span class='d-none'>Copy to clipboard</span>",
                    className:
                        "btn-light-default btn-bgc-white btn-h-outline-primary btn-a-outline-primary",
                },

                {
                    extend: "csv",
                    text: "<i class='fa fa-database text-125 text-success-m1'></i> <span class='d-none'>Export to CSV</span>",
                    className:
                        "btn-light-default btn-bgc-white btn-h-outline-primary btn-a-outline-primary",
                },

                {
                    extend: "print",
                    text: "<i class='fa fa-print text-125 text-orange-d1'></i> <span class='d-none'>Print</span>",
                    className:
                        "btn-light-default btn-bgc-white  btn-h-outline-primary btn-a-outline-primary",
                    autoPrint: false,
                    message:
                        "This print was produced using the Print button for DataTables",
                },
            ],
        },

        // first and last column are not sortable
        columnDefs: [
            {
                orderable: false,
                className: null,
                targets: 0,
            },
            {
                orderable: false,
                className: null,
                targets: 1,
            },
            {
                orderable: false,
                className: null,
                targets: -1,
            },
            {
                responsivePriority: 1,
                targets: 2,
            },
        ],

        // multiple row selection
        select: {
            style: "multis",
        },

        // no specific initial ordering
        order: [],

        language: {
            search: '<i class="fa fa-search pos-abs mt-2 pt-3px ml-25 text-blue-m2"></i>',
            searchPlaceholder: " Search Employees...",
        },
    });

    // specify position of table buttons
    $(".table-tools-col")
        .append($_table.buttons().container())
        // move searchbox into table header
        .find(".dataTables_filter")
        .appendTo(".page-tools")
        .find("input")
        .addClass("pl-45 radius-round")
        .removeClass("form-control-sm")
        // and add a "+" button
        .end()
        .append(
            '<button data-rel="tooltip" type="button" class="btn radius-round btn-outline-primary border-2 btn-sm ml-2" title="Add New"><i class="fa fa-plus"></i></button>'
        );

    // helper methods to add/remove bgc-h-* class when selecting/deselecting rows
    var _highlightSelectedRow = function (row) {
        row.querySelector("input[type=checkbox]").checked = true;
        row.classList.add("bgc-success-l3");
        row.classList.remove("bgc-h-default-l4");
    };
    var _unhighlightDeselectedRow = function (row) {
        row.querySelector("input[type=checkbox]").checked = false;
        row.classList.remove("bgc-success-l3");
        row.classList.add("bgc-h-default-l4");
    };

    // listen to select/deselect event to highlight rows
    $_table
        .on("select", function (e, dt, type, index) {
            if (type == "row") {
                var row = $_table.row(index).node();
                _highlightSelectedRow(row);
            }
        })
        .on("deselect", function (e, dt, type, index) {
            if (type == "row") {
                var row = $_table.row(index).node();
                _unhighlightDeselectedRow(row);
            }
        });

    // when clicking the checkbox in table header, select/deselect all rows
    $(tableId).on("click", "th input[type=checkbox]", function () {
        if (this.checked) {
            $_table
                .rows()
                .select()
                .every(function () {
                    _highlightSelectedRow(this.node());
                });
        } else {
            $_table
                .rows()
                .deselect()
                .every(function () {
                    _unhighlightDeselectedRow(this.node());
                });
        }
    });

    // don't select row if we click on the "show details" `plus` sign (td)
    $(tableId).on("click", "td.dtr-control", function (e) {
        e.stopPropagation();
    });

    // add/remove bgc-h-* class to TH when soring columns
    var previousTh = null;
    var toggleTH_highlight = function (th) {
        th.classList.toggle("bgc-yellow-l2");
        th.classList.toggle("bgc-h-yellow-l3");
        th.classList.toggle("text-blue-d2");
    };

    $(tableId).on("click", "th:not(.sorting_disabled)", function () {
        if (previousTh != null) toggleTH_highlight(previousTh); // unhighlight previous TH
        toggleTH_highlight(this);
        previousTh = this;
    });

    // don't select row when clicking on the edit icon
    $("a[data-action=edit").on("click", function (e) {
        e.preventDefault();
        e.stopPropagation(); // don't select
    });

    // add a dark border
    $(".dataTables_wrapper")
        .addClass("border-b-1 border-x-1 brc-default-l2")

        // highlight DataTable header
        // also already done in CSS, but you can use custom colors here
        .find(".row:first-of-type")
        .addClass("border-b-1 brc-default-l3 bgc-blue-l4")
        .next()
        .addClass("mt-n1px"); // move the next `.row` up by 1px to go below header's border

    // highlight DataTable footer
    $(".dataTables_wrapper")
        .find(".row:last-of-type")
        .addClass("border-t-1 brc-default-l3 mt-n1px bgc-default-l4");

    // if the table has scrollbars, add ace styling to it
    $(".dataTables_scrollBody").aceScroll({
        color: "grey",
    });

    //enable tooltips
    setTimeout(function () {
        $(".dt-buttons button").each(function () {
            var div = $(this).find("span").first();
            if (div.length == 1)
                $(this).tooltip({
                    container: "body",
                    title: div.parent().text(),
                });
            else
                $(this).tooltip({
                    container: "body",
                    title: $(this).text(),
                });
        });
        $("[data-rel=tooltip").tooltip({
            container: "body",
        });
    }, 0);
});

function range(start, end) {
    return Array(end - start + 1)
        .fill()
        .map((_, idx) => start + idx);
}

function Users() {
    const [users, setUsers] = useState([]);
    const [length, setLength] = useState(10);
    const [page, setPage] = useState([]);
    let numPage = 0;
    const [num, setNum] = useState(0);
    const [numbers, setNumbers] = useState([]);

    const [token, setToken] = useState(localStorage.getItem("token"));
    const urls = "http://127.0.0.1:8000/api";

    let history = useHistory();

    const show = (event) => {
        setLength(event.target.value);
        if (event.target.value > users.length) {
            setNum(0);
            numPage = 0;
            setPage(users);
        } else {
            setPage(users.slice(0, event.target.value));
            setNumbers(range(1, Math.ceil(users.length / event.target.value)));
            setNum(0);
            numPage = 0;
        }
    };

    const minus = () => {
        setPage(users.slice((num - 1) * length, num * length));
        setNum(num - 1);
    };
    const plus = () => {
        setPage(users.slice((num + 1) * length, (num + 2) * length));
        setNum(num + 1);
    };

    const selectPage = (event) => {
        numPage = parseInt(event.target.value) - 1;
        setNum(numPage);
        setPage(users.slice(numPage * length, (numPage + 1) * length));
        console.log(users.slice(numPage * length, (numPage + 1) * length));
    };

    const getUsers = async () => {
        let url = urls + "/users";
        let options = {
            method: "get",
            url: url,
            headers: {
                Authorization: "Bearer " + token,
                Accept: "Application/json",
            },
        };
        let response = await axios(options);
        let data = response.data;
        setUsers(data);
        if (10 > data.length) {
            setPage(data);
        } else {
            setPage(data.slice(0, 10));
            setNumbers(range(1, Math.ceil(data.length / 10)));
        }
    };

    const deleteUser = async (userId) => {
        const Swal = require("sweetalert2");
        Swal.fire({
            title: "Are you sure?",
            text: "You won't be able to revert this!",
            icon: "warning",
            iconColor: "#FFBB47",
            showCancelButton: true,
            confirmButtonColor: "#16537e",
            cancelButtonColor: "#d33",
            confirmButtonText: "Confirm",
        }).then(async (result) => {
            if (result.isConfirmed) {
                let url = urls + "/deleteUser/" + userId;
                let options = {
                    method: "DELETE",
                    url: url,
                    headers: {
                        Authorization: "Bearer " + token,
                        Accept: "Application/json",
                    },
                };
                let response = await axios(options);
                if (response && response.status === 200) {
                    Swal.fire({
                        title: "Deleted!",
                        text: "Your file has been deleted.",
                        icon: "success",
                        iconColor: "#3dc00c",
                    }).then(async () => getUsers());
                }
            }
        });
    };

    useEffect(() => {
        AOS.init();
        AOS.refresh();
        getUsers();
    }, []);

    return (
        <div className="page-content container container-plus">
            <div className="page-header mb-2 pb-2 flex-column flex-sm-row align-items-start align-items-sm-center py-25 px-1">
                <h1 className="page-title text-primary-d2 text-140">
                    DataTables
                    <small className="page-info text-dark-m3">
                        <i className="fa fa-angle-double-right text-80" />
                        dynamic responsive tables
                    </small>
                </h1>
                <div className="page-tools mt-3 mt-sm-0 mb-sm-n1">
                    {/* dataTables search box will be inserted here dynamically */}
                    <div id="datatable_filter" className="dataTables_filter">
                        <label>
                            <i className="fa fa-search pos-abs mt-2 pt-3px ml-25 text-blue-m2" />
                            <input
                                type="search"
                                className="form-control pl-45 radius-round"
                                placeholder=" Search Employees..."
                                aria-controls="datatable"
                            />
                        </label>
                        <button
                            data-rel="tooltip"
                            type="button"
                            className="btn radius-round btn-outline-primary border-2 btn-sm ml-2"
                            title
                            data-original-title="Add New"
                        >
                            <i className="fa fa-plus" />
                        </button>
                    </div>
                </div>
            </div>
            <div className="card bcard h-auto">
                <form autoComplete="off" className="border-t-3 brc-blue-m2">
                    <div
                        id="datatable_wrapper"
                        className="dataTables_wrapper dt-bootstrap4 no-footer border-b-1 border-x-1 brc-default-l2"
                    >
                        <div className="row border-b-1 brc-default-l3 bgc-blue-l4">
                            <div className="col-12 col-sm-6">
                                <div
                                    className="dataTables_length text-left w-auto"
                                    id="datatable_length"
                                >
                                    <label>
                                        Show{" "}
                                        <select
                                            name="datatable_length"
                                            aria-controls="datatable"
                                            className="custom-select custom-select-sm form-control form-control-sm"
                                        >
                                            <option value={10}>10</option>
                                            <option value={25}>25</option>
                                            <option value={50}>50</option>
                                            <option value={100}>100</option>
                                        </select>{" "}
                                        entries
                                    </label>
                                </div>
                            </div>
                            <div className="col-12 col-sm-6 text-right table-tools-col">
                                <div className="dt-buttons btn-group bgc-white-tp2 text-right w-auto">
                                    {" "}
